import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import ReadingList from './readinglist';
import BestSellerSearch from './bestsellersearch';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <div className='header-content'>
          <button className='header-button'><Link style={{color: 'yellow', textDecoration: 'none'}} to="/">HOME</Link></button>
          <button className='header-button'><Link  to="/bestseller-search">Bestsellers</Link></button>
          <button className='header-button'><Link style={{color: 'yellow', textDecoration: 'none'}} to="/article-search">Articles</Link></button>
          <button className='header-button'><Link style={{color: 'yellow', textDecoration: 'none'}} to="/movie-search">Movies</Link></button>
        </div>
      </Router>

      {/* style={{color: ##FFFC31}} */}



    </div>
  );
}

export default App;
